# we manually mock these objects because mock object cannot be used in multi-process as they are not pickleable
class FakeConnection:
    def __init__(self, data, schema, connection_type) -> None:
        self.__class__.__module__ = connection_type
        self.sql = ""
        self.start_index = 0
        self.data = data
        self.schema = schema
        self.outputtypehandler = None

    def cursor(self):
        return self

    def close(self):
        pass

    @property
    def description(self):
        return self.schema

    def execute(self, sql: str):
        self.sql = sql
        return self

    def fetchall(self):
        return self.data

    def fetchmany(self, row_count: int):
        end_index = self.start_index + row_count
        res = (
            self.data[self.start_index : end_index]
            if end_index < len(self.data)
            else self.data[self.start_index :]
        )
        self.start_index = end_index
        return res

    def getinfo(self, sql_dbms_name):
        return "sqlserver"


class FakeConnectionWithException(FakeConnection):
    def execute(self, sql: str):
        self.sql = sql
        if sql.lower().startswith("select *") and "1 = 0" not in sql:
            raise RuntimeError("Fake exception")
        else:
            return self


def create_connection_oracledb():
    import oracledb

    host = ORACLEDB_CONNECTION_PARAMETERS["host"]
    port = ORACLEDB_CONNECTION_PARAMETERS["port"]
    service_name = ORACLEDB_CONNECTION_PARAMETERS["service_name"]
    username = ORACLEDB_CONNECTION_PARAMETERS["username"]
    password = ORACLEDB_CONNECTION_PARAMETERS["password"]
    dsn = f"{host}:{port}/{service_name}"
    connection = oracledb.connect(user=username, password=password, dsn=dsn)
    return connection


